import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Card from 'react-bootstrap/Card';
import Container from 'react-bootstrap/Container';
import BasicInput from './FormComponents.js';
import Row from 'react-bootstrap/Row';

class ReactCard extends React.Component{

    constructor(props){
        super(props);
    }

    render(){
        return(
            <Container className="mt-5 mb-5">
                <Card>
                    <Card.Body>
                        <Card.Title>Extract Script for Transport</Card.Title>
                        <Row>
                            <BasicInput col="6" id="reqst_cd" name="reqst_cd" placeholder="Request Code" type="email" />
                        </Row>
                    </Card.Body>
                </Card>
            </Container>
        );
    }
}

export default ReactCard;
